import { fetchSensorData } from '../../reduxe/slices/sensorActions';
import { connect } from 'react-redux';
import { SensorDataComponent } from './Datchic';

const mapStateToProps = (state) => ({
  sensorData: state.sensor.sensorData
});

const mapDispatchToProps = ({
  fetchData: fetchSensorData,
})

export default connect(mapStateToProps, mapDispatchToProps)(SensorDataComponent);
